import React from 'react';
import Menu from '../components/menu';
import Ilustracao from '../static/images/sobre/ilustracao.svg';
import FotoAlex from '../static/images/sobre/alex.jpg';

import '../static/styles/sass/sobre.scss';

function sobre(props) {
    return (
        <div>
            <Menu title="Sobre" description="Sem Descrição" />
            <div className="about container">
                <h1>Sobre</h1>

                <div className="about__content row align-items-center mt-5 pt-5">

                    <section className="col-xs-12 col-md-6">
                        <img className="img-fluid" src={Ilustracao} alt="Ilustração" />
                    </section>

                    <section className="col-xs-12 col-md-6">
                        <div className="row align-items-center text-center">
                            <div className="col-8">
                                <h2>Alex Ricardo</h2>
                            </div>
                            <div className="col-4">
                                <img className="img-fluid" src={FotoAlex} alt="Alex Ricardo" />
                            </div>
                        </div>

                    </section>

                </div>
            </div>
        </div>
    );
}

export default sobre;
